import Link from 'next/link';
import withLayout from '../../components/Layout';


const Content = props => {
  return (
    <>
      <li>
        <Link href='/p/[id]' as={`/blog/${props.id}`}>
          <a>{props.id}</a>
        </Link>
      </li>
    </>
    );
}

export default Content;
